mapper.select:

select 

from MST_S_SEIHN
where ENDYMD = #{endymd,jdbcType=NUMERIC}
  and ENDBIN = #{endbin,jdbcType=NUMERIC}
  and HINCD = #{hincd,jdbcType=NCHAR}
  and CHNCD = #{chncd,jdbcType=NUMERIC}
  and CHNEDA = #{chneda,jdbcType=NUMERIC}

mapper.delete:

delete from MST_S_SEIHN
where ENDYMD = #{endymd,jdbcType=NUMERIC}
  and ENDBIN = #{endbin,jdbcType=NUMERIC}
  and HINCD = #{hincd,jdbcType=NCHAR}
  and CHNCD = #{chncd,jdbcType=NUMERIC}
  and CHNEDA = #{chneda,jdbcType=NUMERIC}
